import React, { useState } from 'react'
import { json } from 'react-router'

function Search() {
   const [name,setname]=useState("");
   const fetchData=(value) =>{
    fetch("http://localhost:5000/bgms").then(
    (response) => response.json())
     .then((json) =>{
   const res=json.filter((user)=>{
      return user && user.songname && user.songname.toLoweCase().includes(value)
   });
    console.log(res);
   });
   }
  const handlechange =(value)=>{
    setname(value)
   fetchData(value)
   }
  

  return (
    <div className='Search'>
      <h1>HELLO</h1>
      <input placeholder='Type to search' value={name} onChange={(e)=>handlechange(e.target.value)} />
      
    </div>
  )
}


export default Search;
